    "intelligent-transportation-systems-research-data-exchange-safety-pilot-model-deployment-ba",nt"isopen":
    true,nt"url": null,nt"notes": "The main objectives of the Safety Pilot
    Model Deployment (SPMD) include the exploration of the real-world effectiveness
    of connected vehicle safety applications in multi-modal driving conditions, the
    evaluation of how drivers adapted to the use of this connected vehicle technology,
    and the identification of potential safety benefits as a result of this connected
    vehicle technology. The SPMD data environment contains sanitized mobility data elements
    that were collected from over 2700 vehicles, equipped with connected vehicle technologies,
    traversing the Ann Arbor, MI transportation network. Data collected from roadside
    equipment installed at locations along the transportation network is also included.
    The data in this data environment was collected during two separate months, October
    2012 and April 2013.",nt"license_title": "Other License Specified",nt"extras":
